import Movie from './Movie'


const MovieList = (props) => {

    return (
        
        <>
        {props.movies.map((movie) => (

            <Movie
                key={movie.id}
                movie={movie}
                id={index}
            />
        ))}
        </>
    );

console.log('MovieList->render()');

}

export default MovieList



